import React from "react";

function Home() {
    return (
      <div style={{textAlign:'center'}}>
        <h1 style={{fontSize:"300%"}}>Weebay</h1>
        <p>Welcome to Weebay. Our finest selection of fake clothing and accessories.</p>
      </div>
    );
  }
  export default Home;
